Method.Implementation:
n id

s val=""
s id=$O(^websys.ConfigurationD(0))
if id'="" {

	s obj=##class(websys.Configuration).%OpenId(id)
	i $IsObject(obj) {
		s val=obj.LanguageApp
		d obj.%Close()
		s obj=""
	}
}
Q val

